/*
@author: Eligijus Skersonas
*/
import React, { Component } from "react";
import { Bar } from "react-chartjs-2";

class BarChart extends Component {
  chartData = {
    "labels": [
        "January",
        "February",
        "March",
        "April",
        "May",
        "June",
        "July"
    ],
    "datasets": [
        {
            "label": "Dataset Testing",
            "backgroundColor": [
                "rgba(255, 99, 132, 0.2)",
                "rgba(54, 162, 235, 0.2)",
                "rgba(255, 206, 86, 0.2)",
                "rgba(75, 192, 192, 0.2)",
                "rgba(153, 102, 255, 0.2)",
                "rgba(255, 159, 64, 0.2)"
            ],
            "borderColor": [
                "rgba(255,99,132,1)",
                "rgba(54, 162, 235, 1)",
                "rgba(255, 206, 86, 1)",
                "rgba(75, 192, 192, 1)",
                "rgba(153, 102, 255, 1)",
                "rgba(255, 159, 64, 1)"
            ],
            "borderWidth": 1,
            "data": [
                65,
                59,
                80,
                81,
                56,
                55,
                40
            ]
        }
    ]};

  render() {
    return (
      <div className="chart">
        <Bar data={this.chartData} options={{}} />
      </div>
    );
  }
}

export default BarChart;
